import React from 'react';
import './sign-in.scss';

class SignIn extends React.Component {
    state = {
      email: '',
      password: '',
    }

    render() {
      return (
        <div className="signin">
          <h2> Already Have An Account?</h2>
          <h3>Sign In with your email</h3>
          <form>
            <input name="email" value="email" />
          </form>
        </div>
      );
    }
}
export default SignIn;
